using Ferro.Api.Models;
using Microsoft.AspNetCore.Mvc;

namespace Ferro.Api.Controllers
{
    public class ImagenController : ControllerBase
    {
        [HttpGet("{id}")]
        public IActionResult Get(int id)
        {
            var imagen = "";
            var imagen2 = "";

            try
            {
                byte[] bytes = Convert.FromBase64String(imagen);
                return File(bytes, "image/jpeg"); // Cambia "image/jpeg" según el tipo de imagen que sea
            }
            catch (FormatException)
            {
                return BadRequest("La imagen no está en formato base64 válido");
            }
        }
    

    }
}
